%[text] # Run Anaerobic Digestor for Flow rate jump
clear
clc
activado=0;
%[text] Load Parameters
AnaerobicDigestorParameters
%[text] Simulation time
tspan=10;
%[text] Flow rate
F1=1;
F2jumps=[2 2.25 2.5 2.7 3];
n=length(F2jumps);
%[text] Initial input substrate
sif1=167; % mmol/L
sif2=sif1;
%%
%[text] ## Running
% Inicialization to store value of simulations
tiempos = cell(1, n);
s = cell(1, n);
P_CO2=cell(1, n);
Q_CH4=cell(1, n);
pH=cell(1, n);

for i=1:n
    if i==n
        tspan=6.9;
    end
    F2=F2jumps(i);
    simout=sim('AD_model.slx');
    tiempos{i}=simout.tout;
    s{i}=simout.yout{1}.Values.Data;
    P_CO2{i}=simout.yout{2}.Values.Data;
    Q_CH4{i}=simout.yout{3}.Values.Data; % Store methane production data
    pH{i}=simout.yout{4}.Values.Data;
    subplot(2,2,1) %[output:0227a4b3]
    plot(tiempos{i},s{i})
    if i==1
        hold on
        xlabel('Time, days')
        ylabel('Substrate mM as acetic acid')
    elseif i==n
        legend(cellstr(num2str(F2jumps')))
        ylim([0 40])
    end
    subplot(2,2,2)
    plot(tiempos{i},P_CO2{i})
    if i==1
        hold on
        xlabel('Time, days')
        ylabel('CO_2 Partial Pressure, torr')
    elseif i==n
        ylim([250 350])
    end
    subplot(2,2,3)
    plot(tiempos{i},Q_CH4{i})
    if i==1
        hold on
        xlabel('Time, days')
        ylabel('CH_4 Production Rate L/day')
    elseif i==n
        ylim([0 12])
    end
    subplot(2,2,4)
    plot(tiempos{i},pH{i})
    if i==1
        xlabel('Time, days')
        ylabel('pH')
        hold on
    elseif i==n
        ylim([6.5 7])
    end
end


%[text] Expand figure
fig=gcf;
fig.Position(3:4)=2*fig.Position(3:4); %[output:0227a4b3]
%[text] Restore simulation time to 10 days
tspan=10;
%[text] 

